window.bookSummaryJSON = "<p><b>In a world filled with monsters and supernatural entities, the idea of schools and extracurricular activities being used to identify candidates worthy of advancing was a given.</b></p> <p>Schools and extracurricular activities have been used as a way to provide early advantages for children who strive to work harder and prove themselves from an early age.</p> <p>In this world, where academic success could literally mean the difference between life and death, many students develop emotional baggage. Fortunately for Alexa, she does not suffer from the problems that plague most of her peers.</p> <p>Gifted with an intelligent mind to start, she realized early on that applying herself to both her academic and sports competitions was the number one way to succeed in this world. How can she do it? Shuffle studying, school work, and sports practice, all while being a teenager? The answer is simple: she has no emotions.</p> <p>The only time she truly feels anything is when she increases her attributes. With that as her sole guiding purpose in life, she is determined to advance and grow her attributes as much as possible. What can a girl do in a supernatural world where the only thing holding her back is how hard she is willing to work?</p> <p>Anything she wants.</p> <p>How can a girl with no emotions learn to function as an ordinary student, at least for appearance's sake? Simple, biting sarcasm and deadpan responses.</p> <p>This is the story of Alexa Thyme, a girl unwilling to bend to a world she can't relate to.</p>"; 
